arStrings.szText:
{c_label}초당 공격 횟수: {c_number}{s1}{/c}{/c}
{icon:bullet} 무기의 속도에 기반합니다.
{icon:bullet} 기술 및 아이템의 영향을 받아 증가합니다.

{c_label}극대화 확률: {c_number}{s1}{/c}{/c}
{icon:bullet} 공격이 극대화로 적중하면 {c_number}{s2}{/c}의 추가 피해를 줍니다.
{icon:bullet} 기술 및 아이템의 영향을 받아 증가합니다.

{c_label}방패막기 방어량: {c_number}{s1}{/c}{/c}
{icon:bullet} 방패 막기 성공 시 방지하는 피해량입니다.
{icon:bullet} 방패 막기 방어량은 기술 및 아이템의 영향을 받아 증가합니다.

{c_label}최대 생명력: {c_number}{s2}{/c}{/c}
{icon:bullet} 생명력이 모두 떨어지면 죽습니다. 
{icon:bullet} 생명력은 기술 및 아이템의 영향을 받아 증가합니다.

{c_label}처치 시 생명력 회복량: {c_number}{s1}{/c}{/c}
{icon:bullet} 적을 처치할 때마다 생명력을 {c_number}{s2}{/c}씩 회복합니다.
{icon:bullet} 처치 시 생명력 회복량은 기술 및 아이템의 영향을 받아 증가합니다.

{c_label}적중당 생명력 회복량: {c_number}{s1}{/c}{/c}
{icon:bullet} 적에게 공격이 적중할 때마다 생명력을 {c_number}{s2}{/c}씩 회복합니다.
{icon:bullet} 적중당 생명력 회복량은 기술 및 아이템의 영향을 받아 증가합니다.

{c_label}극대화 추가 피해: {/c}{c_number}{s1}{/c}
{icon:bullet} 기술 및 아이템의 영향을 받아 증가합니다.
{icon:bullet} 다른 플레이어가 상대일 때 {c_number}{s2}{/c}의 한도가 적용됩니다.

{c_label}이동 속도:{/c} {c_number}{s1}{/c}
{icon:bullet} 기본 이동 속도의 {c_number}{s2}{/c}로 달립니다.
{icon:bullet} 아이템의 영향으로 증가하는 이동 속도의 최대치는 {c_number}+25.00%{/c}입니다.

{c_label}추가 경험치: {c_number}{s1}{/c}{/c}
{icon:bullet} 괴물 처치로 획득하는 경험치가 {c_number}{s2}{/c} 증가합니다.
{icon:bullet} 계수: {c_number}{s3}x{/c}. 이 계수는 멀티플레이어 게임에서 주어집니다.

{c_label}가시:{/c} {c_number}{s1}{/c}
{icon:bullet} 직접 공격에 적중당하면 공격자에게 피해를 줍니다. 지속 피해 효과로는 발동하지 않습니다.
{icon:bullet} 주는 피해는 주요 능력치의 영향을 받아 증가합니다.

{c_label}최대 생명력: {c_number}{s2}{/c}{/c}
{icon:bullet} 추종자는 생명력이 모두 떨어지면 짧은 시간 동안 무력화됩니다. 
{icon:bullet} 생명력은 기술 및 아이템의 영향을 받아 증가합니다.

{c_label}최대 생명력: {c_number}{s2}{/c}{/c}
{icon:bullet} 추종자는 생명력이 모두 떨어지면 짧은 시간 동안 무력화됩니다. 
{icon:bullet} 생명력은 기술 및 아이템의 영향을 받아 증가합니다.

{c_label}최대 생명력: {c_number}{s2}{/c}{/c}
{icon:bullet} 추종자는 생명력이 모두 떨어지면 짧은 시간 동안 무력화됩니다. 
{icon:bullet} 생명력은 기술 및 아이템의 영향을 받아 증가합니다.

{c_label}광역 피해:{/c} {c_number}{s1}{/c}
{icon:bullet} 공격 시 {c_number}{s2}{/c}의 확률로 {c_number}{s4}미터{/c} 내의 적에게도 {c_number}{s3}{/c}의 피해를 줍니다.
{icon:bullet} 피해량은 아이템의 영향을 받아 증가합니다.

{c_label}{s1} 피해 증가:{/c} {c_number}{s2}{/c}
{icon:bullet} 이 원소를 사용하는 기술로 주는 피해가 증가합니다.
{icon:bullet} {s3} 공격력: {c_number}{s4}{/c}

{c_label}의지력:{/c} {c_number}{s1}{/c} {c_lightgray}(아이템의 영향: {c_blue}{s4}{/c}){/c}{s2}
{icon:bullet} 받는 치유량 {c_number}{s3}{/c} 향상
{icon:bullet} {c_important}{u}제압{/u}{/c_important} 피해 {c_number}{s5}{/c} 증가

{c_label}처치 시 피해 보호막: {c_number}{s1}{/c}{/c}
{icon:bullet} 적을 처치할 때 피해 보호막을 얻습니다.
{icon:bullet} 흡수량은 아이템의 영향으로 증가합니다.

{c_label}물약 재사용 대기시간 감소: {c_number}{s1}{/c}{/c}
{icon:bullet} 물약의 재사용 대기시간이 감소합니다.
{icon:bullet} 아이템의 영향으로 더욱 감소합니다.

{c_label}제압 확률:{/c} {c_number}{s1}{/c}
{icon:bullet} 제압이 현재 생명력과 보강된 생명력의 합에 따라 추가 피해를 줍니다.
{icon:bullet} 지속 피해, 지속 효과, 정신 집중 기술은 제압할 수 없습니다.
